import sys

def addStrings(num1: str, num2: str) -> str:
    sys.set_int_max_str_digits(10000)
    return str(sum([int(num1),int(num2)]))

def main() -> None:
    print(addStrings("11", "123"))
    print(addStrings("456", "77"))
    print(addStrings("0", "0"))
    print(addStrings("1", ""))
    
if __name__ == "__main__":
    main()